import React from 'react'
import Puzzle from 'react-image-puzzle';

const PuzzleGame = () => {

    return (
        <div className="puzzle">
            <Puzzle image='https://4.bp.blogspot.com/-NDWfppuLSlc/WwRIIoIn3OI/AAAAAAAA6OQ/1WTdcONWjSgwjpnd2Gpp5ncMsV7E-DGcgCLcBGAs/s1600/Paw_Patrol_Core_Poster_TM_Towerl_Nick_Jr_Nickelodeon_Preschool_USA_Press.jpg'
            level='3'/>
        </div>
    )
}

export default PuzzleGame
